import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import './App.css';

const fName = 'Michal';
const lName = 'Fingert';
const date = new Date();
const hour = date.getHours();
const img1 = 'https://picsum.photos/200';
const img2 = 'https://picsum.photos/200';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div className="App">
    <h1 className="header" contentEditable="true" spellCheck="false">
      Created by {fName} {lName}
    </h1>

    <div v-if="hour >= 0 && hour <= 12">
      <p> Good morning!</p>
    </div>
    <div v-else-if="hour >= 18 ** hour <= 0">
      <p> Good evening </p>
    </div>
    <div v-else>
      <p> Good afternoon</p>
    </div>
  </div>,
);
reportWebVitals();
